.dashboard {
  &-container {
    margin: 30px;
  }
  &-text {
    font-size: 30px;
    line-height: 46px;
  }
}
.header {
  width: 100%;
  height: 50px;
  background: #3A71A8;
  box-shadow: 0 0 10px 5px rgba(153, 153, 153, 0.1);
  display: flex;
  flex-direction: row;
  align-items: center;
  &-title {
    margin-left: 20px;
    font-size: 20px;
    font-weight: bold;
    color: #fff;
  }
}
.main-step-content {
  width: 100%;
  min-height: 400px;
  padding: 20px;
  overflow-y: auto;
  /deep/ .el-step__description {
    padding-right: 0%;
    margin-top: 10px;
    margin-bottom: 10px;
    font-size: 12px;
    line-height: 20px;
    font-weight: normal;
  }
}
.detail-card {
  width: 100%;
  min-height: 120px;
  background: #fff;
  box-shadow: 0 0 10px 5px rgba(153, 153, 153, 0.1);
}
.detail-img {
  width: 20%;
  height: 80px;
}
.detail-title {
  width: 50%;
  min-height: 120px;
  display: flex;
  flex-direction: column;
  margin-left: 10px;
  &-1 {
    font-size: 20px;
    font-weight: bold;
    color: #3A71A8;
    margin-bottom: 10px;
    margin-top: 10px;
  }
  &-2 {
    font-size: 12px;
    color: #333;
    margin-top: 10px;
  }
}
.divider {
  width: 100%;
  height: 0;
  border: 2px solid #409EFF;
}
.table-box {
  width: 100%;
  min-height: 400px;
  background: #fff;
  box-shadow: 0 0 10px 5px rgba(153, 153, 153, 0.1);
  padding: 10px;
}
.box-title {
  width: 100%;
  height: 40px;
  &-span {
    color: #4AB7BD;
    font-size: 20px;
    font-weight: bold;
  }
}
.vertical-divider {
  width: 0;
  height: 90px;
  border-left: #999 1px solid;
  margin-left: 20px;
}
.status-box {
  width: 30%;
  height: 100%;
  display: flex;
  flex-direction: column;
}
.status-title {
  color: #4ab7bd;
  font-size: 18px;
  font-weight: bold;
  margin-left: 20px;
}
.status-label {
  width: 100%;
  height: 80px;
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: center;
}
.main-step-header {
  width: 100%;
  height: 60px;
  background: #fff;
  box-shadow: 0 0 10px 5px rgba(153, 153, 153, 0.1);
  display: flex;
  flex-direction: row;
  align-items: center;
}
.col_dialog {
  width: 100%;
  min-height: 100px;
  display: flex;
  flex-direction: column;
}
.detail-card-container {
  width: 100%;
  min-height: 120px;
  display: flex;
  flex-direction: row;
  align-items: center;
  padding: 10px;
}
.row-divider {
  width: 90%;
  margin-left: 5%;
  border-top: #999 1px solid;
}
.detail-card-result {
  width: 100%;
  height: 100%;
  padding: 20px;
}
.status-panel{
    width: 100%;
    height: 50px;
    display: flex;
    flex-direction: row;
    align-items: center;
    justify-content: space-around;
}
